"""## Machine Learning Models"""

#data split
from sklearn.model_selection import train_test_split 
#Logistic regression
from sklearn.linear_model import LogisticRegression
#metrics
from sklearn.metrics import confusion_matrix, accuracy_score

X=df.drop(columns=['UDI','Product ID','Type','Target','Failure Type'])
Y=df['Target']
X

"""# **Logistic Regression**
binari problem (F = 1, NF = 0)
"""

X_train, X_test, Y_train, Y_test = train_test_split(X, Y, test_size=0.3)

LR_model = LogisticRegression(max_iter=500, multi_class='multinomial')
LR_model.fit(X_train, Y_train)

# Indicadores
from sklearn.metrics import accuracy_score, precision_score, recall_score, f1_score
y_p = LR_model.predict(X_test)
print("Accuracy on training set: {:.3f}".format(LR_model.score(X_train, Y_train)))
print("Accuracy on test set: {:.3f}".format(LR_model.score(X_test, Y_test)))
print("precision score: {:.3f}".format(precision_score(y_true=Y_test, y_pred=y_p)))
print("recall score: {:.3f}".format(recall_score(y_true=Y_test, y_pred=y_p)))
print("f1 score: {:.3f}".format(f1_score(y_true=Y_test, y_pred=y_p)))

# Matriz de confusin
from sklearn.metrics import plot_confusion_matrix
plot_confusion_matrix(LR_model, X_test, Y_test)  
plt.show()

