# Commented out IPython magic to ensure Python compatibility.
# Librerias
# %matplotlib inline
import numpy as np
import matplotlib.pyplot as plt
import pandas as pd
from sklearn.ensemble import RandomForestClassifier

df1 = pd.read_csv('/content/drive/MyDrive/Colab Notebooks/retoEmpresarial/predictive_maintenance.csv')
df1.head(5)

df1.info()

print(df1['Product ID'].unique())
print(df1['Type'].unique())
print(df1['Failure Type'].unique())

Type_ ={'M':0, 'L':1, 'H':2}
df1['Type'] = df1['Type'].map(Type_)
df1.head()

print(df1['Type'])

data = df1[['Type', 'Air temperature [K]', 'Process temperature [K]', 'Rotational speed [rpm]', 'Torque [Nm]', 'Tool wear [min]', 'Target' ]]
data.head()

# Informacin del dataset
data.info()

# Dividimos los datos en entrenamiento y prueba
from sklearn.model_selection import train_test_split
# X son nuestras variables independientes
X1 = data.drop(["Target"],axis = 1)

# y es nuestra variable dependiente
y1 = data.Target

# Divisin 75% de datos para entrenamiento, 30% de datos para test
X_train1, X_test1, y_train1, y_test1 = train_test_split(X1, y1, test_size=0.3)
# Creaamos el modelo de Bosques Aleatorios (y configuramos el nmero de estimadores (rboles de decisin))
BA_model = RandomForestClassifier(n_estimators = 19, 
                                  random_state = 2016,
                                  min_samples_leaf = 8,)

# Entrenamiento
BA_model.fit(X_train1, y_train1)

# Indicadores
from sklearn.metrics import accuracy_score, precision_score, recall_score, f1_score
y_pred = BA_model.predict(X_test1)
print("Accuracy on training set: {:.3f}".format(BA_model.score(X_train1, y_train1)))
print("Accuracy on test set: {:.3f}".format(BA_model.score(X_test1, y_test1)))
print("precision score: {:.3f}".format(precision_score(y_true=y_test1, y_pred=y_pred)))
print("recall score: {:.3f}".format(recall_score(y_true=y_test1, y_pred=y_pred)))
print("f1 score: {:.3f}".format(f1_score(y_true=y_test1, y_pred=y_pred)))

# Matriz de confusin
from sklearn.metrics import plot_confusion_matrix
plot_confusion_matrix(BA_model, X_test1, y_test1)  
plt.show()